import React, {useEffect} from "react";

const CustomerProfile = ({ id }) => {
  useEffect(function(){
    fetch('https://cyf-react.glitch.me/customers/<ID>')
  }, []
  )

  return (
    <div>
      <p>"Customer Profile":{id} </p>
    </div>
  );
};

export default CustomerProfile;
